import React from "react";
import { Form, Navbar } from "react-bootstrap";
const Mainpage = () => {
  return (
    <div>
      <Form>
        <Navbar style={{ backgroundColor: "white", width: "3%" }}>
          <img src="" class="img-rounded" />
        </Navbar>
      </Form>
    </div>
  );
};

export default Mainpage;
